import Logo from '../assets/images/liveOakLogo.png'
function Header() {
    return (
        <nav className='flex mt-4 ml-3 justify-around bg-base-100 mb-48'>
            <img src={Logo} alt="" />
            <h1>Contact Request Form</h1>
        </nav>
    )
}
export default Header
